import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.span`
  margin-right: 7px;
  padding: 12px 12px;
  background: #FEA82F;
  border-radius: 30px;
  font-family: Montserrat;
  font-style: normal;
  font-weight: bold;
  font-size: 14px;
  line-height: 27px;
  color: #FFFFFF;
`;

const Tags = (props) => {
  return <>
    <Wrapper>
      태그
    </Wrapper>
  </>;
}

export default Tags;
